INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('26048833', 'Tartes flambées pays gourmand', 'farine de blé, fromage blanc 19%, eau, lardons fumés 11% [poitrine de porc (origine : UE), sel, dextrose, épices, arôme de fumée, arômes naturels, conservateurs : E250 - E301], oignon 1 1 0%, crème 10%, huile de colza, sel, lait entier en poudre, amidon modifié de maïs, poivre, semoule de blé tendre, émulsifiant : E471 (tournesol), farine de blé malté, agent de traitement de la farine : E920. Pâte : 38% Traces éventuelles de crustacés, poisson, mollusque, moutarde, oeuf. Fabriquées en Alsace à partir de matières premières d\'origine UE. Préchauffer le four à 2500C pendant 10 minutes à chaleur tournante. Retirer la tarte flambée encore surgelée de l\'emballage et la placer directement sur la grille au milieu du four. Laisser cuire environ 8-12 minutes. Surveiller la cuisson et veiller à ne pas trop cuire la tarte, afin que la crème reste bien onctueuse. Le temps de cuisson peut varier en fonction du type de four. La tarte flambée est cuite lorsque la pâte est ferme et le bord commence à brunir. Servir de suite. A consommer de préférence avant fin : voir sur le côté de la boîte. Attention ne jamais recongeler un produit décongelé. A conserver : 24 heures dans un réfrigérateur. 3 jours dans le compartiment à glace du réfrigérateur. Plusieurs mois dans le compartiment à - 180C d\'un congélateur dans la limite du délai optimal de conservation.', '', '12', '3.8', '20', '2.5', '', '6.2', '1.2', '0.47244094488189', '', '0');

