VALUES ('26069975', '80 mini feuilletés', 'farine de blé, eau, margarine (graisses et huiles végétales (palme, colza), eau, sel, émulsifiant : mono- et diglycérides d\'acides gras (palme), correcteur d\'acidité : acide citrique), jambon cuit choix 2,3% (jambon de porc, eau, sel, arômes naturels, légumes en poudre (carottes, blettes), ferments), préparation déshydratée pour sauce type béchamel (lactosérum, amidon modifié de pomme de terre, huile végétale de colza, amidon de blé, lait écrémé en poudre, sirop de glucose, épaississant : alginate de sodium, protéines de lait, arômes naturels, poivre noir, muscade), champignons de Paris 1 ,5%, fromage de chèvre 1 ,3%, purée de tomates 1 ,2%, tomates pelées concassées au jus 1 ,2% (tomates 0,7%, jus de tomates 0,4%, sel, correcteur d\'acidité : acide citrique, stabilisant : chlorure de calcium), poireaux 1 %, noix de Saint-Jacques* 0,9% (Zygoch/amys patagonica : USA (S) ou Argentine (J) ou Uruguay (U) - Chlamys opercularis, origine Royaume-Uni ( R ), Iles Féroé (F) - Argopecten purpuratus : Pérou (P)), oignons, emmental râpé 0,8%, sel, préparation déshydratée pour sauce (lactosérum, amidon modifié de pomme de terre, lait entier en poudre, sel, épaississant : gomme xanthane, poivre, muscade), graines de sésame, graines de pavot, oeuf entier, crème (crème, stabilisant : carraghénanes), fromage de Roquefort fondu 0,4% (Roquefort, eau, amidon modifié de pomme de terre, sel de fonte : citrates de sodium), amidon modifié de blé, préparation fromagère aromatisée en poudre 0,4% (lactosérum, crème, fromages, sel, arômes naturels), oeuf entier en poudre, échalotes, saumon Atlantique 0,3%, saumon fumé Atlantique 0,3% (saumon Atlantique 0,2%, sel), chapelure (farine de blé, eau, sel, levure), vin blanc modifié (vin blanc, sel, arôm8haturel, conser- vateur : anhydride sulfureux), ail, basilic 0,1 %, parmesan râpé 0,1 %, huile d\'olive vierge extra, blanc).\'-œuf, arômes naturels (contient du lait, poissons, crustacés, mollusques), beurre, amidon modifié de pomme de terre, lait entier en poudre, amidon modifié de manioc, poivre noir, estragon. Traces éventuelles de : fruits à coque, céleri, moutarde, soja et sulfites. *L\'origine de la Noix de Saint-Jacques est indiquée par la 1 ère lettre du numéro de lot. Pourcentages exprimés sur rassortiment de mini-feuilletés.', '', '17', '8', '30', '2.6', '', '5.4', '1.1', '0.433070866141732', '', '0');

